import React from 'react'

function Button ({children}) {
    return ( <button>{children}</button> )
}

export default function children() {
  return (
    <div>
      <Button>Click Mel</Button>
      <Button>Submit</Button>
      <Button>Cancle</Button>

    </div>
  )
}
